import React from 'react';

function Projects() {
    return (
        <React.Fragment>
            <section id="portfolio" className="projects">
                <div className="container">
                    <div className="grid">
                        <h3>Email</h3>
                        <h4><a href="mailto:thebleufox8@gmail.com">thebleufox8@gmail.com</a></h4>
                    </div>
                    <a href="https://piano-on-the-go.herokuapp.com/" target="_blank" rel="noreferrer">
                        <div class="project">
                            <h3>Piano on the Go!</h3>
                            <h2>Heroku App</h2>
                        </div>
                    </a>
                    <a href="https://bleufox.github.io/BleusDayPlanner/" target="_blank" rel="noreferrer">
                        <div class="project">
                            <h3>Bleu's Day Planner</h3>
                            <h2>jQuery</h2>
                        </div>
                    </a>
                </div>
            </section >
        </React.Fragment >
    )
}

export default Projects;
